import React from 'react';
import styled from 'styled-components'

const StyledContent = styled.div`
  text-align: center;
  margin-bottom: 200px;
`

 class Content extends React.Component {
   render() {
     return(
         <StyledContent>test</StyledContent>
     )
   }
 }

export default Content;
